import React from 'react';

function PerformanceTableItem(props) {
  return (
    <div
      className={`performanceTableItem__row ${
        props.className ? props.className : ''
      }`}>
      <div className='performanceTableItem'></div>
    </div>
  );
}

export default PerformanceTableItem;
